import React from 'react';
import upIcon from '../../../../../assets/images/up7.svg';
import PropTypes from 'prop-types';

const LatestLaunchesComponent = ({ trend }) => {
    return (
        <div className="latestLaunches">
          <div className="header">
            <div className="title">Trending launches</div>
          </div>
          <div className="trends">
            {trend.map((item) => (
              <div>
                <img src={item.image} />
                <h3>{item.title}</h3>
                <div className="tagline">{item.tagline}</div>
                <div className="actions">
                  <img src={upIcon} width="10px" height="10px" className="arrow" />
                  {item.votesCount} 
                  <span>&#8226;</span> 
                  {item.comments.length} Comments
                </div>
              </div>
            ))}
          </div>
        </div>
    )
}

export default LatestLaunchesComponent;
